#include "MFZAvatarGenMdlMaleVerts.hpp"

using namespace mfz_avatar_gen;

// Class methods

mdl_male_verts::mdl_male_verts(void) : m_male_avg_vertices(c_male_vertices, c_male_vertices + sizeof(c_male_vertices) / sizeof(double)),
                                       m_male_mvn_mu(c_male_mvn_mu, c_male_mvn_mu + sizeof(c_male_mvn_mu) / sizeof(double)),
                                       m_male_ranges(N_MU, std::vector<double>(2, 0)),
                                       m_male_cov(N_MU, std::vector<double>(N_MU, 0)),
                                       m_male_sv(N_VERTS_3, std::vector<double>(N_MU, 0)),
                                       m_male_SkV(N_SKELS, std::vector<double>(3, 0))
{
    // Ranges
    for (unsigned int i = 0; i < N_MU; ++i) {
        for (unsigned int j = 0; j < 2; ++j) {
            m_male_ranges[i][j] = c_male_ranges[i][j];
        }
    }
    // Cov
    for (unsigned int i = 0; i < N_MU; ++i) {
        for (unsigned int j = 0; j < N_MU; ++j) {
            m_male_cov[i][j] = c_male_cov[i][j];
        }
    }
    // Sv
    for (unsigned int i = 0; i < N_VERTS_3; ++i) {
        for (unsigned int j = 0; j < N_MU; ++j) {
            m_male_sv[i][j] = c_male_shape_vectors_transposed[i][j];
        }
    }
    // SkV
    for (unsigned int i = 0; i < N_SKELS; ++i) {
        for (unsigned int j = 0; j < 3; ++j) {
            m_male_SkV[i][j] = c_male_sym_skel[i][j];
        }
    }
}

std::vector<double> &mdl_male_verts::getAvgVerts(void) const {
    return const_cast<std::vector<double>&>(m_male_avg_vertices);
}
std::vector<double> &mdl_male_verts::getMvnMu(void) const {
    return const_cast<std::vector<double>&>(m_male_mvn_mu);
}
std::vector< std::vector<double> > &mdl_male_verts::getCov(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_male_cov);
}
std::vector< std::vector<double> > &mdl_male_verts::getRanges(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_male_ranges);
}
std::vector< std::vector<double> > &mdl_male_verts::getSv(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_male_sv);
}
std::vector< std::vector<double> > &mdl_male_verts::getSkV(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_male_SkV);
}

